import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
    return (
        <>
            <NavLink> About</NavLink>
            <NavLink> Contact</NavLink>
            <br />
            <br />
            <a href="/">About Us</a>
            <a href="/contact">Contact Us</a>

        </>
    )
}

export default Navbar;
